import { GoogleMap, PolygonF, useJsApiLoader } from '@react-google-maps/api';
import React, { useCallback, useState } from 'react';

const containerStyle = {
  width: '100%',
  height: '600px',
};

// Center point set to Jharkhand level
const center = {
  lat: 23.6102,  // Latitude of Jharkhand
  lng: 85.2799,  // Longitude of Jharkhand
};

const zoomLevel = 6;  // Adjusted zoom level for a better view

// Coordinates for the Jharkhand polygon
const jharkhandCoords = [
  { lat: 24.4366, lng: 84.2201 },  // Northern border
  { lat: 24.1851, lng: 85.0568 },  // Slightly south
  { lat: 23.9867, lng: 85.6182 },  // Mid-north
  { lat: 23.6255, lng: 86.4194 },  // North-east
  { lat: 23.1986, lng: 86.8941 },  // Eastern side
  { lat: 22.7767, lng: 86.6826 },  // South-east
  { lat: 22.3571, lng: 85.9870 },  // Southern border
  { lat: 22.2786, lng: 85.3999 },  // South-west
  { lat: 22.7027, lng: 84.8895 },  // West
  { lat: 23.1097, lng: 84.6137 },  // Mid-west
  { lat: 23.7197, lng: 84.4003 },  // North-west
  { lat: 24.0020, lng: 84.4666 },  // Closing the boundary
];

// Coordinates for the Ranchi polygon
const ranchiCoords = [
  { lat: 23.3569, lng: 85.3340 },
  { lat: 23.3722, lng: 85.3332 },
  { lat: 23.3720, lng: 85.3143 },
  { lat: 23.3600, lng: 85.3140 },
  { lat: 23.3575, lng: 85.3267 },
];

const MapComponent = () => {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyChN074R5gt4BfPTFox9UXnND0S8yyH6Dk", // Replace with your Google Maps API key
  });

  const [map, setMap] = useState(null);
  const [isJharkhandPolygonVisible, setIsJharkhandPolygonVisible] = useState(true);
  const [isRanchiVisible, setIsRanchiVisible] = useState(false); // State to control Ranchi visibility

  // Zoom in and fit the Jharkhand polygon's bounds when the button is clicked
  const handleZoomInJharkhand = useCallback(() => {
    if (!map) return;

    const bounds = new window.google.maps.LatLngBounds();
    jharkhandCoords.forEach(coord => bounds.extend(coord));
    map.fitBounds(bounds);

    // Optional: Set a custom zoom level after fitting bounds
    const listener = window.google.maps.event.addListener(map, "idle", () => {
      if (map.getZoom() > 10) {
        map.setZoom(10);  // Set desired zoom level
      }
      window.google.maps.event.removeListener(listener); // Remove the listener after zooming
    });

    // Hide Jharkhand polygon and show Ranchi button and polygon
    setIsJharkhandPolygonVisible(false);
    setIsRanchiVisible(true);
  }, [map]);

  // Save the map instance when loaded
  const onLoad = useCallback((mapInstance) => {
    setMap(mapInstance);
  }, []);

  // Zoom in Ranchi when its button is clicked
  const handleZoomInRanchi = useCallback(() => {
    if (!map) return;

    const bounds = new window.google.maps.LatLngBounds();
    ranchiCoords.forEach(coord => bounds.extend(coord));
    map.fitBounds(bounds);
  }, [map]);

  return isLoaded ? (
    <div style={{ position: 'relative' }}>
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={center}
        zoom={zoomLevel}
        onLoad={onLoad}
      >
        {/* Jharkhand Polygon (only render if visible) */}
        {isJharkhandPolygonVisible && (
          <PolygonF
            paths={jharkhandCoords}
            options={{
              fillColor: '#00FF00',
              strokeColor: '#000000',
              fillOpacity: 0.5,
            }}
            onClick={handleZoomInJharkhand} // Zoom into Jharkhand when clicked
          />
        )}

        {/* Ranchi Polygon (only render if visible) */}
        {isRanchiVisible && (
          <PolygonF
            paths={ranchiCoords}
            options={{
              fillColor: '#FF5733', // Different color for Ranchi
              strokeColor: '#000000',
              fillOpacity: 0.5,
            }}
            onClick={handleZoomInRanchi} // Zoom into Ranchi when clicked
          />
        )}
      </GoogleMap>

      {/* Mapper Button on the Jharkhand polygon */}
      {isJharkhandPolygonVisible && (
        <button
          onClick={handleZoomInJharkhand} // Zoom into Jharkhand when clicked
          style={{
            position: 'absolute',
            top: '50%',  // Center the button vertically
            left: '50%', // Center the button horizontally
            transform: 'translate(-50%, -50%)', // Adjust to truly center the button
            padding: '5px 10px',
            backgroundColor: 'transparent', // Match polygon color
            border: 'none',
            width: '80px', // Adjust width as needed
            height: '30px', // Adjust height as needed
            borderRadius: '5px',
            cursor: 'pointer',
            color: 'transparent', // Make the text transparent
            fontWeight: 'bold', // Bold text
            zIndex: 1,  // Ensure the button is on top of the map
          }}
        >
          Press Here
        </button>
      )}

      {/* Mapper Button on the Ranchi polygon */}
      {isRanchiVisible && (
        <button
          onClick={handleZoomInRanchi} // Zoom into Ranchi when clicked
          style={{
            position: 'absolute',
            top: '40%',  // Adjust position as needed
            left: '50%',
            transform: 'translate(-50%, -50%)', // Center the button
            padding: '5px 10px',
            backgroundColor: 'transparent', // Match polygon color
            border: 'none',
            width: '80px', // Adjust width as needed
            height: '30px', // Adjust height as needed
            borderRadius: '5px',
            cursor: 'pointer',
            color: 'transparent', // Make the text transparent
            fontWeight: 'bold', // Bold text
            zIndex: 1,  // Ensure the button is on top of the map
          }}
        >
          Press Here
        </button>
      )}
    </div>
  ) : <></>;
};

export default MapComponent;
